import React from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
        <div>
          <div className="content">
            <Routes>

              <Route exact path="/" component={Home} />

            </Routes>
          </div>
        </div>
      </BrowserRouter>
  );
}

export default App;
